      <p
        style={{
          paddingLeft: "7pt",
          textIndent: "12pt",
          lineHeight: "91%",
          textAlign: "justify",
        }}
      >
        Definitive UDM allows a drug and metabolite evaluation of drug-use by
        the patient. For example, oxycodone use is determined by testing for
        oxycodone along with three of its metabolites (noroxycodone,
        oxymorphone, and noroxymorphone) and both the identification as well as
        the pattern of quantitative results for these tests underlies a reported
        finding of oxycodone use. The laboratory report also includes the
        quantitative drug and metabolites findings along with an interpretive
        comment on drug-use identification. In the definitive cohort 18,793
        drug-use findings were reported and the highest frequency of drug-use by
        drug class was opiates/opioids (5,225) followed by antidepressants
        (3,038), gabapenti-
      </p>
